INSERT INTO `course_sections` (`id`, `course`, `section`, `name`, `summary`, `summaryformat`, `sequence`, `visible`, `availability`, `timemodified`) VALUES
(1,	1,	1,	NULL,	'',	1,	'7,6,9,11,10,5,12',	1,	NULL,	1593588406),
(2,	2,	0,	'Diskussionslisten',	'<p dir=\"ltr\" style=\"text-align: left;\">Die Diskussionslisten bilden eins der Herzstcke des Vereinslebens des MHN.</p><p dir=\"ltr\" style=\"text-align: left;\">Du kannst Listen im Browser lesen oder per E-Mail mitdiskutieren. Um eine Liste an deine E-Mail-Adresse zu abonnieren, klickst du zuerst auf die Liste und dann auf <i aria-hidden=\"true\" tabindex=\"-1\"></i>Ich mchte das Forum abonnieren\". Du bekommst dann alle Beitrge per E-Mail zugeschickt und kannst auch per E-Mail antworten. Falls du dich um die bersicht in deinem E-Mail-Postfach sorgst, kannst du<a href=\"https://www.mhn.e-nigma.xyz/user/forum.php\"> einstellen, dass du tglich nur eine einzelne E-Mail mit einer Zusammenstellung aller Beitrge des Tages bekommen mchtest</a>. Beachte bitte, dass das Starten eines neuen Themas nicht per E-Mail, sondern nur ber den Browser oder die Moodle-App mglich ist. <strong>Antworte bitte nicht auf eine E-Mail zu einem anderen Thema, wenn du eigentlich ein neues Thema beginnen mchtest.</strong></p>',	1,	'',	1,	'{\"op\":\"&\",\"c\":[],\"showc\":[]}',	1594762742),
(3,	2,	1,	'bergeordnete Listen',	'',	1,	'16,14',	1,	NULL,	1594762848),
(12,	4,	0,	'Informationen fr alle Mitglieder',	'',	1,	'31,26',	1,	'{\"op\":\"&\",\"c\":[],\"showc\":[]}',	1594764741),
(15,	4,	2,	'Dokumente',	'',	1,	'18',	1,	NULL,	1593822808),
(16,	4,	3,	'Verborgene Elemente',	'<p dir=\"ltr\" style=\"text-align: left;\">bitte nicht lschen!</p>',	1,	'29',	0,	'{\"op\":\"&\",\"c\":[],\"showc\":[]}',	1594767067),
(19,	2,	2,	'Thematische Listen',	'<p dir=\"ltr\" style=\"text-align: left;\">Klicke auf ein Thema, das dich interessiert, um mitzudiskutieren und/oder es per E-Mail zu abonnieren. Die Beitragsaufkommen sind sehr unterschiedlich. Wenn dir ein Thema fehlt, dann schreibe an die Aktivenliste, um es vorzuschlagen.</p>',	1,	'21,22',	1,	'{\"op\":\"&\",\"c\":[],\"showc\":[]}',	1594763724),
(20,	2,	3,	'Regionale Listen',	'<p dir=\"ltr\" style=\"text-align: left;\">Ankndigungen von regionalen Stammtischen usw.</p>',	1,	'23',	1,	'{\"op\":\"&\",\"c\":[],\"showc\":[]}',	1594763810),
(21,	2,	4,	'Weitere Listen und geschtzte Listen',	'<p dir=\"ltr\" style=\"text-align: left;\">Zu einigen Arbeitsgruppen oder vergangenen Seminaren und anderen Veranstaltungen gibt es eigene Kurse, die in der Regel auch eine Diskussionsliste enthalten. Der Zugang zu den Kursen in mglicherweise an Voraussetzungen geknpft wie die Teilnahme an der jeweiligen Veranstaltung oder die Mitgliedschaft in der Arbeitsgruppe.</p>',	1,	'24',	1,	'{\"op\":\"&\",\"c\":[],\"showc\":[]}',	1594764663),
(24,	4,	1,	'Wiki',	'',	1,	'30',	1,	NULL,	1594767945);
