(2,	2,	'general',	'Wer wei was?',	'<p dir=\"ltr\" style=\"text-align: left;\">Dies ist meist die Liste mit dem hchsten Mailaufkommen. Stelle hier Fragen zu beliebigen Themen, zu denen du selbst keine Antwort finden konntest, oder hilf anderen, ihre Fragen zu beantworten.</p>',	1,	0,	0,	0,	0,	0,	100,	0,	0,	2097152,	3,	0,	1,	0,	0,	1594763636,	0,	0,	0,	0,	0,	0,	0,	0),
(4,	2,	'general',	'Aktive',	'<p dir=\"ltr\" style=\"text-align: left;\">Hier werden Ideen zur Zukunft des MHN diskutiert. Diese Liste ist offen fr alle Mitglieder, denn das MHN lebt vom Mitmachen! Hier findest du Mitstreiter*innen fr deine Ideen, Informationen zu geplanten Treffen und hnliches.</p>',	1,	0,	0,	0,	0,	0,	100,	0,	0,	10485760,	3,	0,	1,	0,	0,	1594763609,	0,	0,	0,	0,	0,	0,	0,	0),
(7,	2,	'general',	'Lehramt',	'',	1,	0,	0,	0,	0,	0,	100,	0,	0,	2097152,	3,	0,	1,	0,	0,	1594763715,	0,	0,	0,	0,	0,	0,	0,	0),
(8,	2,	'general',	'Unternehmer*innen',	'',	1,	0,	0,	0,	0,	0,	100,	0,	0,	2097152,	3,	0,	1,	0,	0,	1594763731,	0,	0,	0,	0,	0,	0,	0,	0),
(9,	2,	'general',	'Ruhrgebiet',	'',	1,	0,	0,	0,	0,	0,	100,	0,	0,	2097152,	3,	0,	1,	0,	0,	1594764211,	0,	0,	0,	0,	0,	0,	0,	0),
(11,	4,	'blog',	'Newsletter',	'<p dir=\"ltr\">Der monatliche Newsletter informiert dich ber aktuelle Veranstaltungen, kommende Seminare und anderes aus dem Verein.<br></p>\r\n<p dir=\"ltr\">Klicke rechts unter Einstellungen auf <em>Ich mchte das Forum abonnieren</em>&nbsp;bzw. <em>abbestellen</em>, um die Zustellung den Newsletters per E-Mail zu aktivieren bzw. zu deaktivieren.</p><p dir=\"ltr\">Bitte teile Informationen, die im nchsten Newsletter erscheinen sollen, hier mit:&nbsp;<a href=\"https://www.mhn.e-nigma.xyz/mod/forum/view.php?id=29\">Newsletter-Hinweise</a><br></p><br>',	1,	0,	0,	0,	0,	0,	100,	0,	0,	2097152,	3,	2,	1,	0,	0,	1594767912,	0,	0,	0,	0,	0,	0,	0,	0),
(14,	4,	'general',	'Newsletter-Hinweise',	'',	1,	0,	0,	0,	0,	0,	100,	0,	0,	512000,	9,	0,	1,	0,	0,	1594767548,	0,	0,	0,	0,	0,	0,	0,	0),
(15,	4,	'news',	'Rundmails an alle Mitglieder',	'Informationen vom Vorstand an alle Mitglieder, etwa zu Wahlen. Alle Beitrge werden automatisch auch an deine E-Mail-Adresse gesendet.',	1,	0,	0,	0,	0,	0,	0,	0,	0,	2097152,	1,	1,	1,	0,	0,	1594768904,	0,	0,	0,	0,	0,	0,	0,	0);
