     ]\n        }\n      ]\n    },\n    \"importance\": \"high\",\n    \"options\": [\n      {\n        \"value\": \"basic\",\n        \"label\": \"Basic [ 3x = 12 ]\"\n      },\n      {\n        \"value\": \"intermediate\",\n        \"label\": \"Intermediate [ 4x - 3 = 13 ]\"\n      },\n      {\n        \"value\": \"advanced\",\n        \"label\": \"Advanced [ 5x + 3 = 3x + 15 ]\"\n      }\n    ],\n    \"default\": \"intermediate\"\n  },\n  {\n    \"name\": \"useFractions\",\n    \"type\": \"boolean\",\n    \"label\": \"Enable fractions\",\n    \"description\": \"Enable to allow fractions in equations.\",\n    \"default\": false,\n    \"widget\": \"showWhen\",\n    \"showWhen\": {\n      \"rules\": [\n        {\n          \"field\": \"quizType\",\n          \"equals\": [\n            \"linearEquation\"\n          ]\n        }\n      ]\n    }\n  },\n  {\n    \"name\": \"maxQuestions\",\n    \"type\": \"number\",\n    \"label\": \"Max number of questions\",\n    \"importance\": \"medium\",\n    \"default\": 20,\n    \"min\": 2,\n    \"max\": 100\n  },\n  {\n    \"name\": \"UI\",\n    \"type\": \"group\",\n    \"label\": \"User interface translations\",\n    \"importance\": \"low\",\n    \"common\": true,\n    \"fields\": [\n      {\n        \"name\": \"score\",\n        \"type\": \"text\",\n        \"label\": \"Scoring during quiz\",\n        \"importance\": \"low\",\n        \"default\": \"Score:\"\n      },\n      {\n        \"name\": \"time\",\n        \"type\": \"text\",\n        \"label\": \"Time\",\n        \"importance\": \"low\",\n        \"default\": \"Time: @time\"\n      },\n      {\n        \"name\": \"resultPageHeader\",\n        \"type\": \"text\",\n        \"label\": \"Result page header\",\n        \"importance\": \"low\",\n        \"default\": \"Finished!\"\n      },\n      {\n        \"name\": \"go\",\n        \"type\": \"text\",\n        \"label\": \"Go label\",\n        \"importance\": \"low\",\n        \"default\": \"GO!\"\n      },\n      {\n   