(100,	'H5P.GuessTheAnswer',	'Guess the Answer',	1,	4,	8,	1,	0,	'iframe',	'guess-the-answer.js',	'guess-the-answer.css',	'',	'[\n  {\n    \"label\": \"Task description\",\n    \"importance\": \"medium\",\n    \"name\": \"taskDescription\",\n    \"type\": \"text\",\n    \"widget\": \"html\",\n    \"description\": \"Describe how the user should solve the task.\",\n    \"enterMode\": \"p\",\n    \"tags\": [\n      \"strong\",\n      \"em\",\n      \"u\",\n      \"a\",\n      \"ul\",\n      \"ol\",\n      \"h2\",\n      \"h3\",\n      \"hr\",\n      \"pre\",\n      \"code\"\n    ],\n    \"optional\": true\n  },\n  {\n    \"name\": \"media\",\n    \"type\": \"group\",\n    \"label\": \"Media\",\n    \"importance\": \"medium\",\n    \"fields\": [\n      {\n        \"name\": \"type\",\n        \"type\": \"library\",\n        \"label\": \"Type\",\n        \"importance\": \"medium\",\n        \"options\": [\n          \"H5P.Image 1.1\",\n          \"H5P.Video 1.5\"\n        ],\n        \"optional\": true,\n        \"description\": \"Optional media to display above the question.\"\n      }\n    ]\n  },\n  {\n    \"label\": \"Descriptive solution label\",\n    \"importance\": \"low\",\n    \"name\": \"solutionLabel\",\n    \"type\": \"text\",\n    \"widget\": \"textarea\",\n    \"default\": \"Click to see the answer.\",\n    \"description\": \"Clickable text area where the solution will be displayed.\",\n    \"optional\": true\n  },\n  {\n    \"label\": \"Solution text\",\n    \"importance\": \"high\",\n    \"name\": \"solutionText\",\n    \"type\": \"text\",\n    \"widget\": \"textarea\",\n    \"description\": \"The solution for the picture.\"\n  }\n]\n',	NULL,	1,	19),
(101,	'H5P.PersonalityQuiz',	'Personality Quiz',	1,	0,	8,	1,	0,	'iframe',	'js/personalityQuiz.js, js/wheelAnimation.js',	'css/personalityQuiz.css',	'',	'[\n    {\n        \"name\": \"titleScreen\",\n        \"type\": \"group\",\n        \"label\": \"Title Screen\",\n        \"expanded\": true,\n        \"fields\": [\n            {\n                \"name\": \"title\",\n                \"type\": \"group\",\n                \"label\": \"Title\",\n                \"expanded\": true,\n                \"fields\": [\n                    {\n                        \"name\": \"text\",\n                        \"type\": \"text\",\n                        \"label\": \"Title\"\n                    },\n                    {\n                        \"name\": \"display\",\n                        \"type\": \"boolean\",\n                        \"label\": \"Display Title\",\n                        \"description\": \"Wether or not to show the title as a headline at the start of the personality quiz.\",\n                        \"default\": true\n                    }\n                ]\n            },\n            {\n                \"name\": \"image\",\n                \"type\": \"group\",\n                \"label\": \"Optional: Image\",\n                \"optional\": true,\n                \"fields\": [\n                    {\n                        \"name\": \"file\",\n                        \"type\": \"image\",\n                        \"label\": \"File\"\n                    },\n                    {\n                        \"name\": \"alt\",\n                        \"type\": \"text\",\n                        \"label\": \"Alt text\",\n                        \"description\": \"Alternative text if the browser is unable to load the image.\"\n                    }\n                ]\n            },\n            {\n                \"name\": \"skip\",\n                \"label\": \"Skip\",\n                \"type\": \"boolean\",\n                \"description\": \"Select if you want the quiz to start on the first question instead of the title screen.\",\n                \"default\": false\n            }\n        ]\n    },\n    {\n        \"name\": \"resultScreen\",\n        \"type\": \"group\",\n        \"label\": \"Result screen\",\n        \"fields\": [\n            {\n                \"name\": \"animation\",\n                \"type\": \"select\",\n                \"label\": \"Animation\",\n                \"description\": \"The Wheel of Fortune animation will only use the images associated with personalities if ALL personalities has an image associated with them.\",\n                \"default\": \"none\",\n                \"options\": [\n                    {\n                        \"label\": \"None\",\n                        \"value\": \"none\"\n                    },\n                    {\n                        \"label\": \"Fade in\",\n                        \"value\": \"fade-in\"\n                    },\n                    {\n                        \"label\": \"Wheel of Fortune\",\n                        \"value\": \"wheel\"\n                    }\n                ]\n            },\n            {\n                \"name\": \"displayTitle\",\n                \"type\": \"boolean\",\n                \"label\": \"Display personality title?\",\n                \"default\": true\n            },\n            {\n                \"name\": \"displayDescription\",\n                \"type\": \"boolean\",\n                \"label\": \"Display description?\",\n                \"default\": true\n            },\n            {\n                \"name\": \"imagePosition\",\n                \"type\": \"select\",\n                \"label\": \"Personality Image Position\",\n                \"description\": \"Choose how to display the image, if there is any, of the result personality. Background will fill the entire H5P container and center the image. Inline will put the image as an image element between the result personality name and description.\",\n                \"default\": \"background\",\n                \"options\": [\n                    {\n                        \"value\": \"background\",\n                        \"label\": \"Background\"\n                    },\n                    {\n                        \"value\": \"inline\",\n                        \"label\": \"Inline\"\n                    }\n                ]\n            }\n        ]\n    },\n    {\n        \"name\": \"personalities\",\n        \"type\": \"list\",\n        \"label\": \"Personality\",\n        \"entity\": \"personality\",\n        \"min\": 2,\n        \"max\": 10,\n        \"field\": {\n            \"name\": \"personality\",\n            \"type\": \"group\",\n            \"label\": \"Personality\",\n            \"fields\": [\n                {\n                    \"name\": \"name\",\n                    \"type\": \"text\",\n                    \"label\": \"Personality name\",\n                    \"description\": \"The personality name will be used to associate answers with their respective personalities.\"\n                },\n                {\n                    \"name\": \"description\",\n                    \"type\": \"text\",\n                    \"label\": \"Description\",\n                    \"maxLength\": 450,\n                    \"widget\": \"textarea\"\n                },\n                {\n                    \"name\": \"image\",\n                    \"type\": \"group\",\n                    \"label\": \"Optional: Image\",\n                    \"optional\": true,\n                    \"fields\": [\n                        {\n                            \"name\": \"file\",\n                            \"type\": \"image\",\n                            \"label\": \"Image\",\n                            \"description\": \"An image to display on the result screen.\"\n                        },\n                        {\n                            \"name\": \"alt\",\n                            \"type\": \"text\",\n                            \"label\": \"Alt text\",\n                            \"description\": \"Alternative text if the browser is unable to load the image.\"\n                        }\n                    ]\n                }\n            ]\n        }\n    },\n    {\n        \"name\": \"questions\",\n        \"type\": \"list\",\n        \"label\": \"Questions\",\n        \"entity\": \"question\",\n        \"field\": {\n            \"name\": \"question\",\n            \"type\": \"group\",\n            \"label\": \"Question\",\n            \"fields\": [\n                {\n                    \"name\": \"text\",\n                    \"type\": \"text\",\n                    \"label\": \"Question\"\n                },\n                {\n                    \"name\": \"image\",\n                    \"type\": \"group\",\n                    \"label\": \"Optional: Image\",\n                    \"description\": \"Image displayed at the top of the screen above or below the question text.\",\n                    \"optional\": true,\n                    \"fields\": [\n                        {\n                            \"name\": \"file\",\n                            \"type\": \"image\",\n                            \"label\": \"File\"\n                        },\n                        {\n                            \"name\": \"alt\",\n                            \"type\": \"text\",\n                            \"label\": \"Alt text\",\n                            \"description\": \"Alternative text if the browser is unable to load the image.\"\n                        }\n                    ]\n                },\n                {\n                    \"name\": \"answers\",\n                    \"type\": \"list\",\n                    \"label\": \"Answers\",\n                    \"entity\": \"answer\",\n                    \"min\": 2,\n                    \"max\": 6,\n                    \"field\": {\n                        \"name\": \"answer\",\n                        \"type\": \"group\",\n                        \"label\": \"Answer\",\n                        \"fields\": [\n                            {\n                                \"name\": \"text\",\n                                \"type\": \"text\",\n                                \"label\": \"text\"\n                            },\n                            {\n                                \"name\": \"personality\",\n                                \"type\": \"text\",\n                                \"label\": \"Personalities\",\n                                \"description\": \"A comma separated list of personality names associated with this answer.\"\n                            },\n                            {\n                                \"name\": \"image\",\n                                \"type\": \"group\",\n                                \"description\": \"Images associated with answers will not show up unless all answers associated with a question has an image attached.\",\n                                \"label\": \"Optional: Image\",\n                                \"optional\": true,\n                                \"fields\": [\n                                    {\n                                        \"name\": \"file\",\n                                        \"type\": \"image\",\n                                        \"label\": \"File\"\n                                    },\n                                    {\n                                        \"name\": \"alt\",\n                                        \"type\": \"text\",\n                                        \"label\": \"Alt text\",\n                                        \"description\": \"Alternative text if the browser is unable to load the image.\"\n                                    }\n                                ]\n                            }\n                        ]\n                    }\n                }\n            ]\n        }\n    },\n    {\n        \"label\": \"Start\",\n        \"name\": \"startText\",\n        \"type\": \"text\",\n        \"default\": \"Start\",\n        \"description\": \"Text displayed on the start quiz button on the title card.\"\n    },\n    {\n        \"label\": \"Progress text\",\n        \"name\": \"progressText\",\n        \"type\": \"text\",\n        \"default\": \"@question of @total\",\n        \"description\": \"Progress text, variables available: @question and @total. Example: \'@question of @total\'\"\n    },\n    {\n        \"name\": \"retakeText\",\n        \"label\": \"Retake\",\n        \"type\": \"text\",\n        \"default\": \"Retake the quiz\",\n        \"description\": \"Retake text\"\n    },\n    {\n        \"name\": \"animation\",\n        \"type\": \"boolean\",\n        \"label\": \"Animation\",\n        \"default\": true,\n        \"description\": \"Uncheck to turn off all animation\"\n    },\n    {\n        \"name\": \"buttonColor\",\n        \"type\": \"text\",\n        \"label\": \"Button Accent\",\n        \"description\": \"Change the color of the button borders and the animation color fill\",\n        \"default\": \"4D5DAA\",\n        \"widget\": \"colorSelector\"\n    },\n    {\n        \"name\": \"progressbarColor\",\n        \"type\": \"text\",\n        \"label\": \"Progressbar Color\",\n        \"description\": \"Determines the color of the progress bar\",\n        \"default\": \"38B755\",\n        \"widget\": \"colorSelector\"\n    }\n]\n',	NULL,	NULL,	NULL),
