(115,	'H5P.ImageSlider',	'Image Slider',	1,	1,	0,	1,	1,	'iframe',	'image-slider.js',	'image-slider.css',	'',	'[\n  {\n    \"label\": \"Images\",\n    \"name\": \"imageSlides\",\n    \"type\": \"list\",\n    \"field\": {\n      \"label\": \"Image Slide\",\n      \"name\": \"imageSlide\",\n      \"type\": \"group\",\n      \"fields\": [\n        {\n          \"label\": \"Image Slide\",\n          \"name\": \"imageSlide\",\n          \"type\": \"library\",\n          \"options\": [\n            \"H5P.ImageSlide 1.1\"\n          ]\n        }\n      ]\n    }\n  },\n  {\n    \"label\": \"Aspect ratio\",\n    \"name\": \"aspectRatioMode\",\n    \"type\": \"select\",\n    \"description\": \"Automatic means fixed aspect ratio automatically determined based on the images\",\n    \"default\": \"auto\",\n    \"options\": [\n      {\n        \"value\": \"auto\",\n        \"label\": \"Automatic\"\n      },\n      {\n        \"value\": \"custom\",\n        \"label\": \"Custom\"\n      },\n      {\n        \"value\": \"notFixed\",\n        \"label\": \"Not fixed\"\n      }\n    ]\n  },\n  {\n    \"label\": \"Aspect Ratio Settings\",\n    \"name\": \"aspectRatio\",\n    \"type\": \"group\",\n    \"widget\": \"showWhen\",\n    \"expanded\": true,\n    \"showWhen\": {\n      \"rules\": [\n        {\n          \"field\": \"aspectRatioMode\",\n          \"equals\": \"custom\"\n        }\n      ]\n    },\n    \"fields\": [\n      {\n        \"label\": \"Aspect ratio width\",\n        \"name\": \"aspectWidth\",\n        \"type\": \"number\",\n        \"default\": 4,\n        \"description\": \"If you use 4 here, and 3 for the height the aspect ratio will be 4:3\"\n      },\n      {\n        \"label\": \"Aspect ratio height\",\n        \"name\": \"aspectHeight\",\n        \"type\": \"number\",\n        \"default\": 3,\n        \"description\": \"If you use 3 here, and 4 for the width the aspect ratio will be 4:3\"\n      }\n    ]\n  },\n  {\n    \"name\": \"a11y\",\n    \"type\": \"group\"