(116,	'H5P.Essay',	'Essay',	1,	2,	3,	1,	0,	'iframe',	'scripts/essay.js, scripts/inputfield.js',	'styles/essay.css',	'',	'[\n  {\n    \"name\": \"media\",\n    \"type\": \"group\",\n    \"label\": \"Media\",\n    \"importance\": \"medium\",\n    \"fields\": [\n      {\n        \"name\": \"type\",\n        \"type\": \"library\",\n        \"label\": \"Type\",\n        \"importance\": \"medium\",\n        \"options\": [\n          \"H5P.Image 1.1\",\n          \"H5P.Video 1.5\"\n        ],\n        \"optional\": true,\n        \"description\": \"Optional media to display above the question.\"\n      },\n      {\n        \"name\": \"disableImageZooming\",\n        \"type\": \"boolean\",\n        \"label\": \"Disable image zooming\",\n        \"importance\": \"low\",\n        \"default\": false,\n        \"optional\": true,\n        \"widget\": \"showWhen\",\n        \"showWhen\": {\n          \"rules\": [\n            {\n              \"field\": \"type\",\n              \"equals\": \"H5P.Image 1.1\"\n            }\n          ]\n        }\n      }\n    ]\n  },\n  {\n    \"name\": \"taskDescription\",\n    \"label\": \"Task description\",\n    \"type\": \"text\",\n    \"widget\": \"html\",\n    \"importance\": \"high\",\n    \"description\": \"Describe your task here. The task description will appear above text input area.\",\n    \"placeholder\": \"Summarize the book in 500 characters ...\",\n    \"enterMode\": \"div\",\n    \"tags\": [\n      \"strong\",\n      \"em\",\n      \"u\",\n      \"a\",\n      \"ul\",\n      \"ol\",\n      \"h2\",\n      \"h3\",\n      \"hr\",\n      \"pre\",\n      \"code\"\n    ]\n  },\n  {\n    \"name\": \"placeholderText\",\n    \"label\": \"Help text\",\n    \"type\": \"text\",\n    \"description\": \"This text should help the user to get started.\",\n    \"placeholder\": \"This book is about ...\",\n    \"importance\": \"low\",\n    \"optional\": true\n  },\n  {\n    \"name\": \"solution\",\n    \"type\": \"group\",\n    \"label\": \"Sample solution\",\n    \"importance\": \"high\",\n    \"expanded\": true,\n    \"description\": \"You can optionally add a sample solution that\'s shown after the student created a text. It\'s called sample solution because there probably is not only one solution\",\n    \"fields\": [\n      {\n        \"name\": \"introduction\",\n        \"type\": \"text\",\n        \"label\": \"Introduction\",\n        \"importance\": \"low\",\n        \"description\": \"You can optionally leave the students some explanations about your example. The explanation will only show up if you add an example, too.\",\n        \"placeholder\": \"Please remember that you were not expected to come up with the exact same solution. It\'s just a good example.\",\n        \"optional\": true,\n        \"widget\": \"html\",\n        \"enterMode\": \"div\",\n        \"tags\": [\n          \"strong\",\n          \"em\",\n          \"u\",\n          \"a\",\n          \"ul\",\n          \"ol\",\n          \"hr\",\n          \"code\"\n        ]\n      },\n      {\n        \"name\": \"sample\",\n        \"type\": \"text\",\n        \"label\": \"Sample solution text\",\n        \"importance\": \"low\",\n        \"description\": \"The student will see a \\\"Show solution\\\" button after submitting if you provide some text here.\",\n        \"optional\": true,\n        \"widget\": \"html\",\n        \"enterMode\": \"div\",\n        \"tags\": [\n          \"strong\",\n          \"a\"\n        ]\n      }\n    ]\n  },\n  {\n    \"name\": \"keywords\",\n    \"label\": \"Keywords\",\n    \"importance\": \"high\",\n    \"type\": \"list\",\n    \"widgets\": [\n      {\n        \"name\": \"VerticalTabs\",\n        \"label\": \"Default\"\n      }\n    ],\n    \"min\": 1,\n    \"entity\": \"Keyword\",\n    \"field\": {\n      \"name\": \"groupy\",\n      \"type\": \"group\",\n      \"label\": \"Keyword\",\n      \"fields\": [\n        {\n          \"name\": \"keyword\",\n          \"type\": \"text\",\n          \"labe