(120,	'H5P.BranchingScenario',	'Branching Scenario (beta)',	1,	2,	0,	1,	0,	'iframe',	'dist/dist.js',	'styles/branchingScenario.css, styles/branchingQuestion.css, styles/genericScreen.css, styles/libraryScreen.css',	'',	'[\n  {\n    \"name\": \"branchingScenario\",\n    \"type\": \"group\",\n    \"widget\": \"branchingScenario\",\n    \"label\": \"Branching Scenario Editor\",\n    \"importance\": \"high\",\n    \"fields\": [\n      {\n        \"name\": \"title\",\n        \"label\": \"Title\",\n        \"type\": \"text\",\n        \"importance\": \"high\"\n      },\n      {\n        \"name\": \"startScreen\",\n        \"label\": \"Start screen\",\n        \"type\": \"group\",\n        \"importance\": \"low\",\n        \"fields\": [\n          {\n            \"name\": \"startScreenTitle\",\n            \"label\": \"Course Title\",\n            \"placeholder\": \"Title for your course\",\n            \"type\": \"text\",\n            \"importance\": \"medium\",\n            \"optional\": true\n          },\n          {\n            \"name\": \"startScreenSubtitle\",\n            \"label\": \"Course Details\",\n            \"placeholder\": \"Details about the course\",\n            \"type\": \"text\",\n            \"importance\": \"medium\",\n            \"optional\": true\n          },\n          {\n            \"name\": \"startScreenImage\",\n            \"label\": \"Course image\",\n            \"type\": \"image\",\n            \"optional\": true,\n            \"importance\": \"medium\"\n          }\n        ]\n      },\n      {\n        \"name\": \"endScreens\",\n        \"label\": \"List of end screens\",\n        \"type\": \"list\",\n        \"importance\": \"medium\",\n        \"field\": {\n          \"name\": \"endScreen\",\n          \"label\": \"End screen\",\n          \"type\": \"group\",\n          \"importance\": \"low\",\n          \"fields\": [\n            {\n              \"name\": \"endScreenTitle\",\n              \"label\": \"Title\",\n              \"type\": \"text\",\n              \"importance\": \"medium\",\n              \"optional\": true\n            },\n            {\n              \"name\": \"endScreenSubtitle\",\n              \"label\": \"Text\",\n              \"type\": \"text\",\n              \"importance\": \"medium\",\n              \"optional\": true\n            },\n            {\n              \"name\": \"endScreenImage\",\n              \"label\": \"Image\",\n              \"type\": \"image\",\n              \"importance\": \"medium\",\n              \"optional\": true\n            },\n            {\n              \"name\": \"endScreenScore\",\n              \"label\": \"Score\",\n              \"description\": \"The score will be sent to any LMS, LRS or any other connected service that receives scores from H5P for users who reach the default end scenario\",\n              \"type\": \"number\",\n              \"default\": 0,\n              \"optional\": true\n            },\n            {\n              \"name\": \"contentId\",\n              \"label\": \"Content ID\",\n              \"type\": \"number\",\n              \"max\": 0,\n              \"widget\": \"none\"\n            }\n          ]\n        }\n      },\n      {\n        \"name\": \"content\",\n        \"label\": \"List of branching scenario content\",\n        \"importance\": \"high\",\n        \"type\": \"list\",\n        \"min\": 1,\n        \"entity\": \"content\",\n        \"field\": {\n          \"name\": \"content\",\n          \"type\": \"group\",\n          \"fields\": [\n            {\n              \"name\": \"type\",\n              \"type\": \"library\",\n              \"importance\": \"high\",\n              \"options\": [\n                \"H5P.BranchingQuestion 1.0\",\n                \"H5P.CoursePresentation 1.22\",\n                \"H5P.AdvancedText 1.1\",\n                \"H5P.Image 1.1\",\n                \"H5P.ImageHotspots 1.8\",\n                \"H5P.InteractiveVideo 1.22\",\n                \"H5P.Video 1.5\"\n              ]\n            },\n            {\n              \"name\": \"showContentTitle\",\n              \"label\": \"Show content title in view\",\n              \"description\": \"If selected, the user will see the content title in the top bar above this content\",\n              \"type\": \"boolean\",\n              \"importance\": \"high\"\n            },\n            {\n              \"name\": \"nextContentId\",\n              \"label\": \"Next Content ID (end screens are defined by negative numbers)\",\n              \"type\": \"number\",\n              \"importance\": \"high\",\n              \"widget\": \"none\"\n            },\n            {\n              \"name\": \"feedback\",\n              \"type\": \"group\",\n              \"label\": \"Feedback\",\n              \"fields\": [\n                {\n                  \"name\": \"title\",\n                  \"type\": \"text\",\n                  \"label\": \"Feedback title\",\n                  \"optional\": true\n                },\n                {\n                  \"name\": \"subtitle\",\n                  \"type\": \"text\",\n                  \"label\": \"Feedback text\",\n                  \"optional\": true,\n                  \"widget\": \"html\",\n                  \"enterMode\": \"p\",\n                  \"tags\": [\n                    \"strong\",\n                    \"em\",\n                    \"del\",\n                    \"code\"\n                  ]\n                },\n                {\n                  \"name\": \"image\",\n                  \"type\": \"image\",\n                  \"label\": \"Feedback image\",\n                  \"optional\": true\n                },\n                {\n                  \"name\": \"endScreenScore\",\n                  \"type\": \"number\",\n                  \"label\": \"Score for this scenario\",\n                  \"description\": \"The score will be sent to any LMS, LRS or any other connected service that receives scores from H5P for users who reach this scenario\",\n                  \"optional\": true\n                }\n              ]\n            }\n          ]\n        }\n      },\n      {\n        \"name\": \"scoringOption\",\n        \"type\": \"group\",\n        \"label\": \"Scoring options\",\n        \"importance\": \"low\",\n        \"fields\": [\n          {\n            \"name\": \"scoringOption\",\n            \"label\": \"Scoring options\",\n            \"type\": \"select\",\n            \"description\": \"Select type of scoring\",\n            \"options\": [\n              {\n                \"value\": \"static-end-score\",\n                \"label\": \"Statically set score for each end scenario\"\n              },\n              {\n                \"value\": \"dynamic-score\",\n                \"label\": \"Dynamically calculate score from user answers\"\n              },\n              {\n                \"value\": \"no-score\",\n                \"label\": \"No scoring\"\n              }\n            ],\n            \"default\": \"no-score\"\n          }\n        ]\n      },\n      {\n        \"name\": \"l10n\",\n        \"type\": \"group\",\n        \"label\": \"Localization\",\n        \"importance\": \"low\",\n        \"common\": true,\n        \"fields\": [\n          {\n            \"name\": \"startScreenButtonText\",\n            \"label\": \"Text for the button on the start screen\",\n            \"type\": \"text\",\n            \"importance\": \"low\",\n            \"default\": \"Start the course\"\n          },\n          {\n            \"name\": \"endScreenButtonText\",\n            \"label\": \"Text for the button on the end screen\",\n            \"type\": \"text\",\n            \"importance\": \"low\",\n            \"default\": \"Restart the course\"\n          },\n          {\n            \"name\": \"proceedButtonText\",\n            \"label\": \"Text for the button on each of the library screens\",\n            \"type\": \"text\",\n            \"importance\": \"low\",\n            \"default\": \"Proceed\"\n          },\n          {\n            \"name\": \"scoreText\",\n            \"label\": \"Label for score on the end screen\",\n            \"type\": \"text\",\n            \"importance\": \"low\",\n            \"default\": \"Your score:\"\n          }\n        ]\n      }\n    ]\n  }\n]',	NULL,	NULL,	NULL),
