INSERT INTO `label` (`id`, `course`, `name`, `intro`, `introformat`, `timemodified`) VALUES
(3,	1,	'\r\n\r\nIm Mind-Hochschul-Netzwerk (MHN) treffen sich ...',	'<p dir=\"ltr\" style=\"text-align: left;\">\r\n</p>\r\n<p><span style=\"font-size: 0.95rem;\">Im Mind-Hochschul-Netzwerk (MHN) treffen sich hochintelligente und wissenschaftlich interessierte Menschen mit Freude an lebenslangem Lernen und Lehren. Das MHN versteht sich als Mitmach-Netzwerk, das von allen Mitgliedern durch ehrenamtliches Engagement\r\n    getragen wird. Bei uns treffen verschiedenste akademische Disziplinen aufeinander, um von- und miteinander zu lernen.</span><br></p>\r\n<p>Gegrndet 2001 als Projekt des Vereins Mensa in Deutschland (MinD) e. V., Deutschlands grtem Verein fr hochbegabte Menschen, hat sich das MHN zu einer Organisation mit eigenen Strukturen und groer Reichweite entwickelt. Ein IQ-Test ist fr die Mitgliedschaft\r\n    beim MHN nicht notwendig.</p>\r\n<h2>Aktuelles</h2>\r\n<p>Wie in der Mitgliederversammlung am 5. Oktober 2018 beschlossen, wird das MHN als eigener Verein eingetragen. Wir arbeiten aktuell an der Vereinseintragung und der Aktualisierung der Homepage. Bis dahin bitten wir noch um etwas Geduld. (Stand 8. Dezember\r\n    2018)\r\n</p>\r\n<h2>Veranstaltungen</h2>\r\n<p>Wir organisieren regelmig deutschlandweite Veranstaltungen und vernetzen uns in Regionalgruppen. Die mehrtgige Mind-Akademie, das Mind-Symposium und eine Vielfalt kleinerer Seminare und Outdoor-Veranstaltungen.</p>\r\n<p>\r\n</p>\r\n<h3>\r\n    Seminare und Outdoor-Veranstaltungen</h3>\r\n<p>ber das ganze Jahr verteilt finden auerdem Seminare und Outdoor-Veranstaltungen statt. Unsere Mitglieder lassen hier andere an ihrer Expertise teilhaben und knnen dadurch auch ihre eigenen Prsentations- und Moderationskompetenzen ausbauen.</p>\r\n<p></p>\r\n<h3>Mind-Akademie</h3>\r\n<p>Unsere wichtigste berregionale Groveranstaltung ist die jhrliche Mind-Akademie. Vier volle Tage im Frhherbst sind dem interdisziplinren Austausch in Vortrgen, Workshops und persnlichen Gesprchen gewidmet. Es kommen ber 250 Teilnehmer aus allen\r\n    akademischen Disziplinen zusammen, die sich gemeinsam zu Themenberichen aus Natur- und Geisteswissenschaften, Wirtschaft und Technik, Theorie und Praxis mit einem Leitthema auseinandersetzen werden.</p>\r\n<p>Wegen der Kontaktbeschrnkungen muss die Mind-Akademie 2020 leider ausfallen.</p>\r\n<h3>\r\n    Mind-Symposium</h3>\r\n<p>Das MHN-Symposium ist der kleine Bruder der Mind-Akademie. Dabei werden sich Hochschulen mit ihren typischen Forschungsgebieten und Jung-Wissenschaftler*innen, die Mitglied des MHN oder von Mensa sind, mit einem, zum Oberthema passenden Beitrag, vorstellen.</p>\r\n<p>Das erste Symposium fand am 25. April 2019 unter dem Titel zusammen-getrennt auf dem Jahrestreffen von Mensa in Deutschland e. V. in Hamburg statt.</p>\r\n    <h2>\r\n        Mitgliederbereich</h2>\r\n    <p>Im Mitgliederbereich findest du eine Flle an Informationen ber MHN und Mglichkeiten, dich mit anderen Mitgliedern zu vernetzen. Das Netzwerk lebt von deiner aktiven Beteiligung! Deswegen sind viele Seiten fr dich editierbar.</p><br><p></p>\r\n<p></p>',	1,	1594575888),
(4,	1,	'\r\n    \r\n        \r\n    \r\n    \r\n        Willkommen b...',	'<div style=\"display: flex; justify-content: center; align-items: center;\">\r\n    <div>\r\n        <p dir=\"ltr\" style=\"text-align: center;\"><img src=\"@@PLUGINFILE@@/wordcloud_trans.png?time=1593819136492\" alt=\"MHN als Wordcloud\" width=\"400\" height=\"388\" class=\"img-responsive atto_image_button_middle\"></p>\r\n    </div>\r\n    <div>\r\n        <p dir=\"ltr\" style=\"text-align: left;margin: auto 0px;\">Willkommen beim Mind-Hochschul-Netzwerk, dem Netzwerk motivierter und offener junger Menschen!</p>\r\n    </div>\r\n</div>',	1,	1593820776);
