INSERT INTO `page` (`id`, `course`, `name`, `intro`, `introformat`, `content`, `contentformat`, `legacyfiles`, `legacyfileslast`, `display`, `displayoptions`, `revision`, `timemodified`) VALUES
(1,	1,	'Impressum',	'',	1,	'<p dir=\"ltr\" style=\"text-align: left;\"></p><p>Mind-Hochschul-Netzwerk<br>c/o Dr. Sara Kser<br>In der Gnsweide 1<br>76669 Bad Schnborn</p><p>E-Mail: Ersetzen Sie in&nbsp;<code>beispiel@mind-hochschul-netzwerk.de</code>&nbsp;bitte das Wort&nbsp;<code>beispiel</code>&nbsp;durch&nbsp;<code>vorstand</code>.</p><p>Vertretungsberechtigter Vorstand: Annika Gutschmidt-Khler, Vanessa Vieth, Julia Niggemeyer.</p><p>Inhaltlich verantwortlich gem  5 TMG: Annika Gutschmidt-Khler, Vanessa Vieth, Julia Niggemeyer.</p><h4>Bankverbindung</h4><h1><a name=\"bankverbindung\"></a></h1><p>Mensa in Deutschland e.V.<br>IBAN: DE89 5109 1700 0042 4242 00<br>BIC: VRBUDE51<br>Kreditinstitut: vr bank Untertaunus<br><br>Konto-Nr.: 42424200<br>BLZ: 51091700</p><p></p>',	1,	0,	NULL,	5,	'a:3:{s:12:\"printheading\";s:1:\"1\";s:10:\"printintro\";s:1:\"0\";s:17:\"printlastmodified\";s:1:\"1\";}',	2,	1593814130),
(2,	1,	'Was ist das MHN?',	'',	1,	'<p>\r\n    Uns verbinden vor allem persnliches Engagement und das Bedrfnis, uns kontinuierlich weiterzuentwickeln. Wir sind gespannt auf anregende Standpunkte, neue Sichtweisen und immer wieder Wissenschaft! Uns bewegt das Interesse an kreativen Ideen und der\r\n    Erweiterung des eigenen Horizonts.</p>\r\n<h2><a name=\"_Toc451452\"></a>Was wir machen</h2>\r\n<h3><a name=\"_Toc451453\"></a>1. Wofr steht das MHN?</h3>\r\n<p>Das Mind-Hochschul-Netzwerk (MHN) steht fr Spa am interdisziplinren (M), akademischen (H) und Austausch (N) zwischen aufgeschlossenen jungen Menschen, die sich aktiv in eine anregende Gemeinschaft einbringen mchten und Freude daran haben, ihren beruflichen\r\n    und persnlichen Horizont kontinuierlich zu erweitern. Das M in MHN steht aber auch fr Mitmachen  denn wir leben vom ehrenamtlichen Engagement unserer Mitglieder!\r\n</p>\r\n<h3><a name=\"_Toc451454\"></a>2. Was bietet das MHN?</h3>\r\n<p>Das MHN bietet die Mglichkeit, dich mit anderen kreativen und engagierten jungen Menschen zu vernetzen und gemeinsam akademische und nicht-akademische Veranstaltungen zu organisieren und zu genieen. In Regionalgruppen, die in allen greren Universittsstdten\r\n    vertreten sind, kommen MHNler regelmig zum geselligen Austausch zusammen. Akademische, wie auch private Themen, sind dabei gleichermaen von Bedeutung. Deine fachliche Expertise kannst du als Referent in einem Workshop oder Seminar mit anderen MHN-Mitgliedern\r\n    teilen oder als [nicht lesbar] Teilnehmer erweitern. Unsere Seminare richten wir meist in verschiedenen Jugendherbergen in Deutschland aus und decken eine groe Bandbreite von Themen ab, die sich von Akrobatik und Business English bis hin zu Yoga\r\n    und Zeitmanagement erstrecken.</p>\r\n<p>Das Herzstck des MHN-Jahres ist die Mind-Akademie, bei der ber 200 Mitglieder fr mehrere Tage in einer lockeren Atmosphre fr professionelle Vortrge, Netzwerke und Gedankenaustausche zusammenkommen. Ein sommerliches Pendant zur Akademie ist das Mind-Camp,\r\n    das den Kerngedanken der Akademie unter freien Himmel verlagert. Das gesamte MHN ist eine Plattform zur freien und aktiven Mitgestaltung, in dem die Mitglieder wachsen und sich selbst verwirklichen sollen. Wenn du also noch mehr als die angebotenen\r\n    Veranstaltungen suchst, bist du herzlich dazu eingeladen, selber eigene Seminare und Workshops anzubieten. Das MHN ist letztlich das, was du daraus machst.</p>\r\n<h3><a name=\"_Toc451455\"></a>3. Wie funktioniert das MHN?</h3>\r\n<p>Das MHN ist wie im Organigramm dargestellt aufgebaut. Es lsst sich aber auch in sechs Regeln zusammenfassen:</p>\r\n<h4>1. Wer macht, hat die Macht.</h4>\r\n<p>Wer sich aktiv einbringt, entscheidet auch.</p>\r\n<h4>2. Machs oder sag, dass dus lsst.</h4>\r\n<p>Wer verspricht, etwas zu erledigen, muss es entweder tun oder den anderen mitteilen, dass er es nicht schafft. Beides ist immer akzeptabel. Das Schlimmste fr das MHN ist, eine Arbeit zu blockieren. Wenn ich kommuniziere, dass ich es nicht schaffe, kann\r\n    eine andere Lsung gefunden werden. Bleibt eine Aufgabe liegen, ohne dass jemand anderes davon erfhrt, ist unntig Zeit vergangen und andere sind frustriert.</p>\r\n<h4>3. Differenzen lassen sich nicht per E-Mail lsen.</h4>\r\n<p>Wenn es Differenzen gibt, die zu eskalieren drohen, ist ein Telefonat oder ein persnliches Gesprch ntig. E-Mails sind nicht hilfreich. Im persnlichen Gesprch lassen sich Missverstndnisse, um die es sich meist handelt, schneller klren.</p>\r\n<h4>4. Nein heit nein.</h4>\r\n<p>Wenn jemand klar sagt, dass er eine Aufgabe nicht erledigen will, dann akzeptieren wir das. Ein Aufzwingen schadet nur (siehe oben).</p>\r\n<h4>5. Helfen statt meckern.</h4>\r\n<p>MHN ist ein Netzwerk von Freiwilligen. Nicht alles luft immer rund. Daher ist Kritik immer dann willkommen, wenn du genau da, wo etwas schiefluft, mit anpackst.</p>\r\n<h4>6. Einfach machen.</h4>\r\n<p>Es muss nicht perfekt sein. Es ist besser, zu einer brauchbaren Lsung zu kommen, anstatt eine perfekte nie zu erreichen.</p>\r\n<h3><a name=\"_Toc451456\"></a>4. Was ist die Mind-Akademie?</h3>\r\n<p>Die Mind-Akademie ist die jhrliche Hauptveranstaltung des MHN, die am ersten Wochenende im Oktober stattfindet. Der Veranstaltungsort wechselt jedes Jahr zwischen verschiedenen Jugendherbergen in Deutschland. In den vier bis fnf Tagen werden unter einem\r\n    bestimmten Oberthema (2017: Experimente) Vortrge aus verschiedensten wissenschaftlichen Bereichen angeboten. Begleitet werden sie durch unterschiedliche Workshops, die auch praktische Ttigkeiten nicht zu kurz kommen lassen, und ein abwechslungsreiches\r\n    Rahmenprogramm aus Stadtfhrungen, Museumsbesuchen und Frhsportprogramm [nicht lesbar] bietet [?]. In einem extra Spielezimmer lassen Brettspielefreunde die Abende ausklingen. Die Lounge stellt den zentralen Anlaufpunkt dar, um sich mit den anderen\r\n    Teilnehmern auszutauschen, weiter mit den Referen*tinnen ins Gesprch zu kommen, neue Kontakte zu knpfen oder den Tag einfach Revue passieren zu lassen.\r\n</p>\r\n<p>Alles fr die Mind-Akademie Notwendige wie etwa Verpflegung, Unterkunft, Vortragsprogramm etc. wird dabei ehrenamtlich von den Mitgliedern des MHN organisiert. Die Teilnehmer zahlen lediglich den Selbstkostenpreis, der bewusst so kalkuliert wird, dass\r\n    Studierende sich das Treffen mglichst problemlos leisten knnen.</p>\r\n<h3><a name=\"_Toc451457\"></a>5. Wie kann ich MHN-Mitglied werden?</h3>\r\n<p>\r\n    </p><ol>\r\n        <li>Du fllst das Aufnahmeformular aus.</li>\r\n        <li>Wir prfen deine Antragsdaten und melden uns gegebenenfalls bei Rckfragen.\r\n        </li>\r\n        <li>Wir benachrichtigen dich ber das Ergebnis.</li>\r\n    </ol>\r\n<p></p>\r\n\r\n\r\n<h3><a name=\"_Toc451458\"></a>6. Wo kann ich weitere Informationen erhalten?</h3>\r\n<p>Hast du noch keine Antwort auf deine Fragen gefunden? Schick uns einfach eine Mail an die im Bereich Kontakt genannten Adressen und wir helfen dir gerne weiter.</p><br>',	1,	0,	NULL,	5,	'a:3:{s:12:\"printheading\";s:1:\"1\";s:10:\"printintro\";s:1:\"0\";s:17:\"printlastmodified\";s:1:\"1\";}',	1,	1593819994),
(3,	1,	'Kontakt',	'',	1,	'<p>Wenn du mal eine Frage zum MHN hast, findest du hier Listen mit Ansprechpartnern in unserem Netzwerk.</p>\r\n<p>Darber hinaus bietet das MHN im internen Wiki viele themenbezogene Ansprechpartner, z. B. zu Studienfchern, zu Stipendien, zu Seminaren und zu Auslandsstudien allgemein.</p>\r\n<p>Oder mchtest du erst einmal ins MHN hineinschnuppern? Dann kannst du Kontakt zu deinem lokalen Ansprechpartner aufnehmen und dich nach Regionaltreffen erkundigen. Die Regionalbetreuung nennt dir gerne den zustndigen Ansprechpartner fr deine Region.</p>\r\n<h2><a name=\"_Toc451460\"></a>Vorstand</h2>\r\n\r\n<div style=\"display: flex; justify-content: center; align-items: flex-end; text-align: center;\">\r\n    <div><img src=\"@@PLUGINFILE@@/AnnikaGutschmidt-Koehler.jpg\" alt=\"Annika Gutschmidt-Khler\" width=\"500\" height=\"500\" class=\"img-responsive atto_image_button_middle\"><br>Annika Gutschmidt-Khler</div>\r\n    <div><img src=\"@@PLUGINFILE@@/JuliaNiggemeyer.jpg\" alt=\"Julia Niggemeyer\" width=\"500\" height=\"500\" class=\"img-responsive atto_image_button_middle\"><br>Julia Niggemeyerser</div>\r\n    <div><img src=\"@@PLUGINFILE@@/VanessaVieth.jpg\" alt=\"Vanessa Vieth\" width=\"500\" height=\"500\" class=\"img-responsive atto_image_button_middle\"><br>Vanessa Vieth</div>\r\n</div>\r\n<h2><a name=\"_Toc451461\"></a>E-Mail-Adressen</h2>\r\n<p>Vorstand: <a href=\"mailto:vorstand@mind-hochschul-netzwerk.de\">vorstand@mind-hochschul-netzwerk.de</a></p>\r\n<p>Homepage und Intranet: <a href=\"mailto:webteam@mind-hochschul-netzwerk.de\">webteam@mind-hochschul-netzwerk.de</a>\r\n</p>\r\n<p>Finanzen: <a href=\"mailto:finanzen@mind-hochschul-netzwerk.de\">finanzen@mind-hochschul-netzwerk.de</a>\r\n</p>\r\n<p>Mitgliederbetreuung: <a href=\"mailto:mitgliederbetreuung@mind-hochschul-netzwerk.de\">mitgliederbetreuung@mind-hochschul-netzwerk.de</a>\r\n</p>\r\n<p>Regionalbetreuung: <a href=\"mailto:regionalbetreuung@mind-hochschul-netzwerk.de\">regionalbetreuung@mind-hochschul-netzwerk.de</a>\r\n</p>\r\n<p>Aufnahmekommission: <a href=\"mailto:aufnahmekommission@mind-hochschul-netzwerk.de\">aufnahmekommission@mind-hochschul-netzwerk.de</a>\r\n</p>\r\n<p>Kooperationen: <a href=\"mailto:kooperation@mind-hochschul-netzwerk.de\">kooperation@mind-hochschul-netzwerk.de</a></p><br>\r\n<p></p>',	1,	0,	NULL,	5,	'a:3:{s:12:\"printheading\";s:1:\"1\";s:10:\"printintro\";s:1:\"0\";s:17:\"printlastmodified\";s:1:\"1\";}',	1,	1593820601),
(4,	1,	'Mitglied werden',	'',	1,	'<p>Wir freuen uns ber dein Interesse, dich aktiv im Mind-Hochschul-Netzwerk (MHN) einzubringen. Das MHN lebt vom ehrenamtlichen Einsatz und der Beteiligung jedes Einzelnen. Aus diesem Grund mchten wir uns vor deiner Aufnahme ein erstes Bild von dir machen\r\n    und bitten dich, das folgende Formular vollstndig und umfassend auszufllen. Die erhobenen Daten sind nur fr MHN-interne Zwecke bestimmt, werden vertraulich behandelt und nicht an Dritte weitergegeben.<br></p>\r\n<p>Wenn du dein Formular abgeschickt hast, erhltst du eine automatische Besttigungs-E-Mail, dass deine Bewerbung erfolgreich bei uns eingegangen ist. Anschlieend entscheidet unsere Aufnahmekommission ber deinen Beitritt. In der Regel erhltst du binnen\r\n    einiger Wochen eine Rckmeldung ber ihrer Entscheidung.</p>\r\n<p>Nach deiner Aufnahme wirst du durch den zustndigen Ansprechpartner begrt und fr die internen Bereiche freigeschalten. Dadurch ermglichen wir dir, gut in unserem Kreis anzukommen, dich ber Angebote anderer zu informieren und dich, deine Ideen und\r\n    Erfahrungen mit einzubringen.\r\n</p>\r\n<p>Noch Fragen? Nimm Kontakt mit uns auf.\r\n</p>[Link zum Aufnahmeformular]<br>',	1,	0,	NULL,	5,	'a:3:{s:12:\"printheading\";s:1:\"1\";s:10:\"printintro\";s:1:\"0\";s:17:\"printlastmodified\";s:1:\"1\";}',	1,	1593820884),
(5,	1,	'Datenschutzerklrung',	'',	1,	'<p>Verantwortliche Stelle im Sinne der Datenschutzgesetze, insbesondere der EU-Datenschutzgrundverordnung (DSGVO), ist Mind-Hochschul-Netzwerk, Kontaktstelle:  datenschutz [at] mind-hochschul-netzwerk [dot] de oder an vorstand [at] mind-hochschul-netzwerk [dot] de.</p>\r\n<h2>Ihre Betroffenenrechte</h2>\r\n<p>Unter den angegebenen Kontaktdaten knnen Sie jederzeit folgende Rechte ausben:</p>\r\n<ul>\r\n<li>Auskunft ber Ihre bei uns gespeicherten Daten und deren Verarbeitung,</li>\r\n<li>Berichtigung unrichtiger personenbezogener Daten,</li>\r\n<li>Lschung Ihrer bei uns gespeicherten Daten,</li>\r\n<li>Einschrnkung der Datenverarbeitung, sofern wir Ihre Daten aufgrund gesetzlicher Pflichten noch nicht lschen drfen,</li>\r\n<li>Widerspruch gegen die Verarbeitung Ihrer Daten bei uns und</li>\r\n<li>Datenbertragbarkeit, sofern Sie in die Datenverarbeitung eingewilligt haben oder einen Vertrag mit uns abgeschlossen haben.</li>\r\n</ul>\r\n<p>Sofern Sie uns eine Einwilligung erteilt haben, knnen Sie diese jederzeit mit Wirkung fr die Zukunft widerrufen. Sie knnen sich jederzeit mit einer Beschwerde an die fr Sie zustndige Aufsichtsbehrde wenden. Ihre zustndige Aufsichtsbehrde richtet sich nach dem Bundesland Ihres Wohnsitzes, Ihrer Arbeit oder der mutmalichen Verletzung. Eine Liste der Aufsichtsbehrden (fr den nichtffentlichen Bereich) mit Anschrift finden Sie unter: <a href=\"https://www.bfdi.bund.de/DE/Infothek/Anschriften_Links/anschriften_links-node.html\">https://www.bfdi.bund.de/DE/Infothek/Anschriften_Links/anschriften_links-node.html</a>.</p>\r\n<h2>Zwecke der Datenverarbeitung durch die verantwortliche Stelle und Dritte</h2>\r\n<p>Wir verarbeiten Ihre personenbezogenen Daten nur zu den in dieser Datenschutzerklrung genannten Zwecken. Eine bermittlung Ihrer persnlichen Daten an Dritte findet nur im Rahmen der Auftragsverarbeitung und zu anderen als den genannten Zwecken berhaupt nicht statt. Wir erheben, verarbeiten, speichern oder geben Ihre persnlichen Daten nur an Dritte weiter, wenn:</p>\r\n<ul>\r\n<li>Sie Ihre ausdrckliche Einwilligung dazu erteilt haben (Art. 6 Abs. 1 lit a DSGVO),</li>\r\n<li>die Verarbeitung zur Abwicklung eines Vertrags mit Ihnen erforderlich ist (Art. 6 Abs. 1 lit b DSGVO),</li>\r\n<li>die Verarbeitung zur Erfllung einer rechtlichen Verpflichtung erforderlich ist (Art. 6 Abs. 1 lit c DSGVO) oder</li>\r\n<li>die Verarbeitung zur Wahrung berechtigter Interessen erforderlich ist und kein Grund zur Annahme besteht, dass Sie ein berwiegendes schutzwrdiges Interesse an der Nichtweitergabe Ihrer Daten haben (Art. 6 Abs. 1 lit f DSGVO).</li>\r\n</ul>\r\n<p>Die Verarbeitung und Speicherung Ihrer Daten erfolgt auf Servern der Hetzner Online GmbH mit Standort Deutschland.</p>\r\n<h2>Lschung bzw. Sperrung der Daten</h2>\r\n<p>Wir halten uns an die Grundstze der Datenvermeidung und Datensparsamkeit. Wir speichern Ihre personenbezogenen Daten daher nur so lange, wie dies zur Erreichung der hier genannten Zwecke erforderlich ist oder wie es die vom Gesetzgeber vorgesehenen vielfltigen Speicherfristen vorsehen. Nach Fortfall des jeweiligen Zweckes bzw. Ablauf dieser Fristen werden die entsprechenden Daten routinemig und entsprechend den gesetzlichen Vorschriften gesperrt oder gelscht.</p>\r\n<h2>Erfassung allgemeiner Informationen beim Besuch unserer Website</h2>\r\n<p>Wenn Sie auf unsere Website zugreifen, werden automatisch mittels eines Cookies Informationen allgemeiner Natur erfasst. Diese Informationen (Server-Logfiles) beinhalten etwa die Art des Webbrowsers, das verwendete Betriebssystem, den Domainnamen Ihres Internet-Service-Providers und hnliches. Hierbei handelt es sich ausschlielich um Informationen, welche keine Rckschlsse auf Ihre Person zulassen. Diese Informationen sind technisch notwendig, um von Ihnen angeforderte Inhalte von Webseiten korrekt auszuliefern und fallen bei Nutzung des Internets zwingend an. Sie werden insbesondere zu folgenden Zwecken verarbeitet:</p>\r\n<ul>\r\n<li>Sicherstellung eines problemlosen Verbindungsaufbaus der Website,</li>\r\n<li>Sicherstellung einer reibungslosen Nutzung unserer Website,</li>\r\n<li>Auswertung der Systemsicherheit und -stabilitt sowie</li>\r\n<li>zu weiteren administrativen Zwecken.</li>\r\n</ul>\r\n<p>Die Verarbeitung Ihrer personenbezogenen Daten basiert auf unserem berechtigten Interesse aus den vorgenannten Zwecken zur Datenerhebung (Art. 6 Abs. 1 lit f DSGVO). Wir verwenden Ihre Daten nicht, um Rckschlsse auf Ihre Person zu ziehen. Empfnger der Daten sind nur die verantwortliche Stelle und ggf. Auftragsverarbeiter/-innen. Anonyme Informationen dieser Art werden von uns gegebenenfalls statistisch ausgewertet, um unseren Internetauftritt und die dahinterstehende Technik zu optimieren.</p>\r\n<h2>Cookies</h2>\r\n<p>Wie viele andere Webseiten verwenden auch wir sogenannte Cookies. Cookies sind kleine Textdateien, die von einem Websiteserver auf Ihre Festplatte bertragen werden. Hierdurch erhalten wir automatisch bestimmte Daten wie zum Beispiel IP-Adresse, verwendeter Browser, Betriebssystem und Ihre Verbindung zum Internet. Cookies knnen nicht verwendet werden, um Programme zu starten oder Viren auf einen Computer zu bertragen. Anhand der in Cookies enthaltenen Informationen knnen wir Ihnen die Navigation erleichtern und die korrekte Anzeige unserer Webseiten ermglichen. In keinem Fall werden die von uns erfassten Daten an Dritte weitergegeben oder ohne Ihre Einwilligung eine Verknpfung mit personenbezogenen Daten hergestellt.\r\nNatrlich knnen Sie unsere Website grundstzlich auch ohne Cookies betrachten. Internet-Browser sind regelmig so eingestellt, dass sie Cookies akzeptieren. Im Allgemeinen knnen Sie die Verwendung von Cookies jederzeit ber die Einstellungen Ihres Browsers deaktivieren. Bitte verwenden Sie die Hilfefunktionen Ihres Internetbrowsers, um zu erfahren, wie Sie diese Einstellungen ndern knnen. Bitte beachten Sie, dass einzelne Funktionen unserer Website mglicherweise nicht funktionieren, wenn Sie die Verwendung von Cookies deaktiviert haben.</p>\r\n<h2>SSL-Verschlsselung</h2>\r\n<p>Um die Sicherheit Ihrer Daten bei der bertragung zu schtzen, verwenden wir dem aktuellen Stand der Technik entsprechende Verschlsselungsverfahren (HTTPS / TLS).</p>\r\n<h2>Mitgliedsdaten / Mitgliederverwaltung</h2>\r\n<p>Zur Verwaltung unserer Mitglieder und zur Erbringung von Vereinsleistungen (gem Art. 6 Abs. 1 lit. b DSGVO) erheben wir einige personenbezogene Daten wie Name, Anschrift, Kontakt- und Kommunikationsdaten wie Telefonnummer und E-Mail-Adresse. Darber hinaus knnen Mitglieder weitere Daten wie Interessen, Studienverlauf etc. freiwillig angeben, die wir zur besseren Vernetzung unserer Mitglieder untereinander verwenden (gem Art. 6 Abs. 1 lit. f DSGVO).  Angemeldete Mitglieder haben die Mglichkeit, bei Bedarf die angegebenen Daten jederzeit zu ndern oder zu lschen. Selbstverstndlich erteilen wir Ihnen darber hinaus jederzeit Auskunft ber die von uns ber Sie gespeicherten personenbezogenen Daten. Gerne berichtigen bzw. lschen wir diese auch auf Ihren Wunsch, soweit keine gesetzlichen Aufbewahrungspflichten entgegenstehen. Zur Kontaktaufnahme in diesem Zusammenhang nutzen Sie bitte die am Ende dieser Datenschutzerklrung angegebenen Kontaktdaten.</p>\r\n<h2>Mailinglisten</h2>\r\n<p>Unsere Mailinglisten dienen der Vernetzung unserer Mitglieder untereinander. Die Registrierung fr die Mailinglisten erfolgt innerhalb des Mitgliederprofiles. Dort protokollieren wir die Anmeldung und die zu verwendende E-Mail-Adresse. Die Daten werden ausschlielich fr den Mailinglistenversand verwendet und nicht an Dritte weitergegeben. Die Einwilligung zur Speicherung Ihrer persnlichen Daten und Ihrer Nutzung fr den Mailinglistenversand knnen Sie jederzeit widerrufen. In jeder Mail einer Mailingliste findet sich dazu ein entsprechender Link. Auerdem knnen Sie uns Ihren entsprechenden Wunsch ber die am Ende dieser Datenschutzhinweise angegebene Kontaktmglichkeit mitteilen.</p>\r\n<h2>Anmeldung zu Veranstaltungen</h2>\r\n<p>Falls Sie sich zu einer unserer Veranstaltungen anmelden, erheben wir weitere Daten zur Durchfhrung der Veranstaltung (gem Art. 6 Abs. 1 lit. b DSGVO). Hierzu gehren Ihre Kontaktdaten, Rechnungs- und Zahlungsinformationen sowie weitere freiwillige Angaben (gem Art. 6 Abs. 1 lit a DSGVO) etwa zu Mitfahrgelegenheiten, Essenswnschen oder Nahrungsmittelunvertrglichkeiten. Zweck der Datenerhebung ist die Durchfhrung der Veranstaltung und die Erleichterung der Abwicklung fr Teilnehmende sowie Veranstaltungsdienstleister. Zu diesem Zweck geben wir aggregierte Daten, etwa zur Anzahl vegetarischer Essen und Nahrungsmittelunvertrglichkeiten, an Partner wie etwa Jugendherbergen weiter. Aus den aggregierten Daten ist kein Rckschluss auf einzelne Personen mehr mglich. Veranstaltungsdaten werden ausschlielich fr die jeweilige Veranstaltung verwendet und nach Abschluss der Veranstaltung zeitnah gelscht, soweit keine gesetzlichen Aufbewahrungspflichten entgegenstehen.</p>\r\n<h2>nderung unserer Datenschutzbestimmungen</h2>\r\n<p>Wir behalten uns vor, diese Datenschutzerklrung anzupassen, damit sie stets den aktuellen rechtlichen Anforderungen entspricht oder um nderungen unserer Leistungen in der Datenschutzerklrung umzusetzen, zum Beispiel bei der Einfhrung neuer Services. Fr Ihren erneuten Besuch gilt dann die neue Datenschutzerklrung.</p>\r\n<h2>Fragen an den Datenschutzbeauftragten</h2>\r\n<p>Wenn Sie Fragen zum Datenschutz haben, schreiben Sie uns bitte eine E-Mail:  datenschutz [at] mind-hochschul-netzwerk [dot] de oder an vorstand [at] mind-hochschul-netzwerk [dot] de.</p>\r\n<p><em>Die Datenschutzerklrung wurde teilweise mit dem Datenschutzerklrungs-Generator der activeMind AG erstellt.</em></p>',	1,	0,	NULL,	5,	'a:3:{s:12:\"printheading\";s:1:\"1\";s:10:\"printintro\";s:1:\"0\";s:17:\"printlastmodified\";s:1:\"1\";}',	2,	1593821088);
