INSERT INTO `scale` (`id`, `courseid`, `userid`, `name`, `scale`, `description`, `descriptionformat`, `timemodified`) VALUES
(1,	0,	0,	'Anwendung von Einzelfakten oder ganzheitliche Wissensnutzung',	'Nutzt Wissen ber einzelne Fakten,Reflektiert das Wissen in Einzelfllen,Bercksichtigt den Gesamtzusammenhang und wgt Fakten ab',	'Die Skala basiert auf der Theorie von sachbezogenem, isoliertem und vernetztem, beziehungsorientiertem Denken (Belenky). Die Theorie beschreibt zwei unterschiedliche Wege, wie wir lernen und evaluieren knnen. <ul> <li><<strong>Getrennt/isoliert Denkende</strong> versuchen so objektiv wie mglich zu bleiben und Gefhle und Emotionen nicht zu bercksichtigen. In einer Diskussion mit anderen verteidigen Sie ihre Ideen und analysieren logisch die Ideen der anderen, um darin Schwachstellen zu finden.   </li><li> <strong>Vernetzt/beziehungsorientiert Denkende</strong> sind sehr empfindsam gegenber anderen Menschen. Sie sind gut trainiert, Empathie zu zeigen, anderen zuzuhren und Fragen zu stellen. Sie stellen eine Verbindung zu anderen her und knnen sich in deren Standpunkt hineinversetzen. Sie lernen durch den Austausch von Erfahrungen und das fhrt sie zu dem Wissen anderer Menschen. </li></ul>',	0,	1593467654),
(2,	0,	0,	'Standard-Kompetenzskala',	'Kompetenz noch nicht vorhanden,Kompetenz vorhanden',	'Eine binre Bewertungsskala, die ber keine weiteren Angaben verfgt, ob Kenntnisse und Fertigkeiten unter Beweis gestellt wurden.',	0,	1593467654);
