INSERT INTO `wiki_pages` (`id`, `subwikiid`, `title`, `cachedcontent`, `timecreated`, `timemodified`, `timerendered`, `userid`, `pageviews`, `readonly`) VALUES
(2,	2,	'Willkommen im MHN-Wiki!',	'<p dir=\"ltr\" style=\"text-align:left;\">Bitte beachte, dass das Wiki vor allem geeignet ist, um Textseiten zu erstellen und zu bearbeiten. Als bloe Dokumentenablage bieten sich andere Tools an.</p>\n<p dir=\"ltr\" style=\"text-align:left;\">Klicke auf Bearbeiten, um eine Seite zu verndern. Einen Link zu einer Unterseite (auch, wenn sie noch nicht existiert) fgst du ein, indem du den Titel in doppelte eckige Klammern setzt: [<span></span>[Beispiel]<span></span>] wird der Link zur Unterseite mit dem Titel <a class=\"wiki_newentry\" href=\"https://www.mhn.e-nigma.xyz/mod/wiki/view.php?pageid=3\">Beispiel</a>.</p>\n',	1594768363,	1594768607,	1594824890,	2,	7,	0),
(3,	2,	'Beispiel',	'\n',	1594768612,	1594768612,	1594824896,	2,	1,	0);
